    "## Random Forest\n",
    "Penjelasan\n",
    "Random Forest adalah model berbasis ensemble yang menggabungkan beberapa pohon keputusan (decision tree). Model ini efektif untuk menangani data yang kompleks dan berisik, serta mengurangi risiko overfitting.\n",
    "\n",
    "Parameter yang Digunakan\n",
    "n_estimators: Jumlah pohon dalam hutan.\n",
    "max_depth: Kedalaman maksimum pohon.\n",
    "min_samples_split: Minimum sampel yang diperlukan untuk membagi node.\n",
    "Kelebihan dan Kekurangan\n",
    "Kelebihan: Handal dalam menangani data yang kompleks, serta lebih tahan terhadap overfitting.\n",
    "Kekurangan: Memerlukan lebih banyak sumber daya komputasi, dan interpretasinya lebih sulit dibandingkan dengan model sederhana."
